use reqwest::Client;
use clipboard::ClipboardProvider;
use flite::{Tts, Voice};

#[tokio::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> {
    // Create a client for making HTTP requests to the ElevenLabs API
    let client = Client::new();

    // Create a clipboard provider for reading the contents of the clipboard
    let clipboard = ClipboardProvider::new()?;

    // Read the contents of the clipboard
    let clipboard_contents = clipboard.get_contents()?;

    // Make a request to the ElevenLabs API to generate TTS audio
    let response = client.post("https://api.elevenlabs.io/tts")
        .header("Authorization", "Bearer YOUR_API_KEY")
        .json(&json!({
            "text": clipboard_contents,
            "voice": "en-US",
        }))
        .send()
        .await?
        .text()
        .await?;

    // Write the TTS audio to a file
    std::fs::write("output.wav", response)?;

    // Use the `flite` crate to read the TTS audio aloud
    let tts = Tts::new();
    tts.set_voice(Voice::new("en-US"));
    tts.say(clipboard_contents);

    Ok(())
}
```
